package main

/* colorful spinning teapot */
/* won't work on windows */

import (
	"math"
    "time"
    "fmt"
	"github.com/hortencio-main/go-sr"
)

type Vec3 struct {
    x, y, z float32
}

const (
    PI     = 3.14159                            //
    fov    = 45.0                               // field of view in degrees
    height = 24                                 // framebuffer height in characters
    width  = 80                                 // framebuffer width in characters
    aspect = float32(width*5)/float32(height*8) // aspect ratio (adjusted to 5:8, for a square output on the terminal)
    near   = 0.1                                // near plane
    far    = 100.0                              // far plane
)

var (
    buffer []byte
    colors = []string{
        "\033[0;31m",
        "\033[0;32m",
        "\033[0;33m",
        "\033[0;34m",
        "\033[0;35m",
        "\033[0;36m",
    }
    colorDefault = "\033[0;37m"
    angle float32 = 0
)

func init() {
    sr.Viewport(width, height)                // create an framebuffer
    sr.PolygonMode(sr.FRONT_AND_BACK, sr.FILL)
    buffer = make([]byte, height*(width + 1)) // create an buffer for the terminal output
}

func main() {
	var (
        top    float32 = near * float32(math.Tan(fov * PI / 360.0))
        bottom float32 =        -top
        right  float32 =  top*aspect
        left   float32 =      -right
    )
	proj := sr.Frustum(left, right, bottom, top, near, far) // Set up perspective projection
    
	for {
        
		camPos := Vec3{ 20,20,20 }
        
        view := sr.LookAt( camPos.x, camPos.y, camPos.z, 0, 1.0, 0)
        sr.SetCamera(proj, view)
        sr.ClearColor(0,0,0)
        
        sr.Rotatef([]float32{
            float32(angle),
            0.1,
            1.0,
            0,
        })
        angle += 2.0
        
        sr.Begin()
            for v := 0; v < len(teapot); v+=4 {
                sr.Color3f( 0.1 + 0.1 * float32((v/4)%len(colors)), 0.0, 0.0)
                sr.Vertex3f(teapot[v  ][0],teapot[v  ][1],teapot[v  ][2])
                sr.Vertex3f(teapot[v+1][0],teapot[v+1][1],teapot[v+1][2])
                sr.Vertex3f(teapot[v+2][0],teapot[v+2][1],teapot[v+2][2])
                sr.Vertex3f(teapot[v+3][0],teapot[v+3][1],teapot[v+3][2])
            }
        sr.End()
        
        image := sr.ReadPixels()
        for i := 0; i < height; i++ {
            for j := 0; j < width; j++ {
                
                color := image[j + width*i][0]
                
                if color < .1 {
                    buffer = append(buffer, []byte(colorDefault)...)
                    buffer = append(buffer, ' ')
                } else if color < .2 {
                    buffer = append(buffer, []byte(colors[0])...)
                    buffer = append(buffer, '#')
                } else if color < .3 {
                    buffer = append(buffer, []byte(colors[1])...)
                    buffer = append(buffer, '#')
                } else if color < .4 {
                    buffer = append(buffer, []byte(colors[2])...)
                    buffer = append(buffer, '#')
                } else if color < .5 {
                    buffer = append(buffer, []byte(colors[3])...)
                    buffer = append(buffer, '#')
                } else if color < .6 {
                    buffer = append(buffer, []byte(colors[4])...)
                    buffer = append(buffer, '#')
                } else if color < .7 {
                    buffer = append(buffer, []byte(colors[5])...)
                    buffer = append(buffer, '#')
                }
            }
            buffer = append(buffer, '\n')
        }
        fmt.Println(string(buffer))
        buffer = buffer[:0:0]
        
        time.Sleep(time.Second / 60.0)
    }
}

